import React from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import LandingLogo from '../img/landingLogo.png';

const Landing = () => {
	return (
		<footer
			style={{
				display: 'flex',
				alignItems: 'center',
				justifyContent: 'center',
				height: '5%',
				background: '#2A2A2A',
			}}
			className="text-center"
		>
			<Container fluid>
				<Row>
					<Col xs={4}>
						<img src={LandingLogo} alt="landing logo" />
					</Col>
					<Col xs={8}></Col>
				</Row>
				<Row>
					<img
						class="aligncenter size-full"
						src="https://www.ocf.berkeley.edu/hosting-logos/ocf-hosted-penguin-dark.svg"
						alt="hosted by the ocf"
						width="125"
						height="50"
					></img>
					<a href="http://webatberkeley.org/">
						<p style={{ margin: '0', padding: '.7rem', fontSize: '18px' }}>
							Designed and Built by Web Development at Berkeley
						</p>
					</a>
				</Row>
				<Row>
					<h1>UYGFGHJh</h1>
				</Row>
			</Container>
		</footer>
	);
};

export default Landing;
